/*Table structure for table `BookAuthor` */

DROP TABLE IF EXISTS `BookAuthor`;

CREATE TABLE `BookAuthor` (
  `bkId` int(11) NOT NULL DEFAULT '0',
  `arId` int(11) NOT NULL DEFAULT '0',
  PRIMARY KEY (`bkId`,`arId`),
  KEY `arId` (`arId`),
  CONSTRAINT `BookAuthor_ibfk_2` FOREIGN KEY (`bkId`) REFERENCES `Book` (`bookId`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `BookAuthor_ibfk_1` FOREIGN KEY (`arId`) REFERENCES `Author` (`authorId`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `BookAuthor` */

insert  into `BookAuthor`(`bkId`,`arId`) values (1,1),(2,2),(15,2),(2,3),(2,4),(3,5),(4,5),(3,6),(4,6),(5,7),(10,7),(5,8),(6,9),(7,10),(7,11),(7,12),(8,13),(9,13),(19,13),(11,14),(11,15),(11,16),(12,17),(17,17),(13,18),(13,19),(14,20),(14,21),(16,22),(16,23),(18,24),(20,25),(20,26),(21,27),(21,28);

/*Table structure for table `Publisher` */

DROP TABLE IF EXISTS `Publisher`;

CREATE TABLE `Publisher` (
  `publisherId` varchar(2) NOT NULL DEFAULT '',
  `publisherName` varchar(50) NOT NULL DEFAULT '',
  PRIMARY KEY (`publisherId`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `Publisher` */

insert  into `Publisher`(`publisherId`,`publisherName`) values ('AW','Addison-Wesley Professional'),('MP','Manning Publications'),('OA','O\'Reilly & Associates'),('PH','Prentice Hall PTR'),('WL','Wiley'),('WP','Wrox Press');

